const Nav = ({ search, setSearch }) => {
  return (
    <nav className="Nav">
      <form onSubmit={e => e.preventDefault()} className="searchForm">
        <label htmlFor="search">Search Posts</label>
        <input
          id="search"
          type="text"
          placeholder="Search Posts"
          value={search}
          onChange={e => setSearch(e.target.value)}
        />
      </form>
    </nav>
  );
};

export default Nav;
